	getSeconds() {
		return ('0' + this.state.secondsElapsed % 60).slice(-2);
	}



	render() {
		return (
			<div>
				<h1> {this.getSeconds()} </h1>
				<button onClick={this.handleClick}> start </button>
			</div>
		);
	}

}

export default Home;
